INSERT INTO `tblknowledge_base` (`articleid`, `articlegroup`, `subject`, `description`, `slug`, `active`, `datecreated`, `article_order`, `staff_article`) VALUES
(1, 1, '¿A quién afecta el Real Decreto 413/2014, de 6 de junio?', '<p>Estar&aacute;n inclu&iacute;das en el &aacute;mbito de aplicaci&oacute;n del Real Decreto 413/2014, de 6 de junio las instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos pertenecientes a las categor&iacute;as, grupos y subgrupos definidos en el<span>&nbsp;</span><strong>art&iacute;culo 2 del citado Real Decreto</strong>. Asimismo, es de aplicaci&oacute;n a las instalaciones no incluidas en dicho art&iacute;culo que tuvieran reconocida retribuci&oacute;n primada con anterioridad al 14 de julio de 2013.</p>\r\n<p>A las instalaciones que tuvieran reconocida retribuci&oacute;n primada con anterioridad al 14 de julio de 2013 les aplicar&aacute;n las particularidades establecidas en la disposici&oacute;n transitoria primera y en la disposici&oacute;n adicional segunda del citado Real Decreto 413/2014, de 6 de junio.</p>', 'a-quien-afecta-el-real-decreto-413-2014-de-6-de-junio', 1, '2018-06-14 13:38:47', 0, 0),
(2, 1, '¿Qué instalaciones serán automáticamente inscritas en el Registro de Régimen Retributivo Específico?', '<p>Seg&uacute;n la Disposici&oacute;n transitoria primera del Real Decreto 413/2014, de 6 de junio, quedar&aacute;n autom&aacute;ticamente inscritas en el registro de r&eacute;gimen retributivo espec&iacute;fico las instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos que tuvieran reconocida retribuci&oacute;n primada a la entrada en vigor del Real Decreto-ley 9/2013, de 12 de julio. Tal como se establece en la Orden IET/1168/2014, de 3 de julio, la fecha de inscripci&oacute;n autom&aacute;tica es el 9 de julio de 2014.</p>\r\n<p>Dicha inscripci&oacute;n se realizar&aacute; en estado de preasignaci&oacute;n o en estado de explotaci&oacute;n, seg&uacute;n proceda, de acuerdo con lo siguiente:</p>\r\n<ul class=\"faq-list\">\r\n<li>Quedar&aacute;n inscritas el Registro de r&eacute;gimen retributivo espec&iacute;fico<span>&nbsp;</span><strong>en estado de preasignaci&oacute;n</strong><span>&nbsp;</span>aquellas instalaciones que en el momento de realizar la inscripci&oacute;n autom&aacute;tica no est&eacute;n dadas de alta en el sistema de liquidaci&oacute;n, y que tuvieran reconocida retribuci&oacute;n primada.</li>\r\n<li>Quedar&aacute;n inscritas<span>&nbsp;</span><strong>en estado de explotaci&oacute;n<span>&nbsp;</span></strong>aquellas instalaciones que en el momento de realizar la inscripci&oacute;n autom&aacute;tica est&eacute;n dadas de alta en el sistema de liquidaci&oacute;n, sin perjuicio de lo previsto en las disposiciones adicionales s&eacute;ptima y octava del Real Decreto 413/2014, de 6 de junio.</li>\r\n</ul>\r\n<p>(Disposici&oacute;n transitoria primera del<span>&nbsp;</span><a href=\"http://www.boe.es/diario_boe/txt.php?id=BOE-A-2014-6123\" target=\"_blank\" rel=\"noopener\">Real Decreto 413/2014, de 6 de junio</a>)</p>', 'que-instalaciones-seran-automaticamente-inscritas-en-el-registro-de-regimen-retributivo-especifico', 1, '2018-06-14 13:39:20', 0, 0),
(3, 1, '¿Dónde se recogen las bases del Régimen Retributivo Específico?', '<p>En la<span>&nbsp;</span><a href=\"http://www.boe.es/buscar/act.php?id=BOE-A-2013-13645&amp;tn=1&amp;p=20140328&amp;vd=#a14\" target=\"_blank\" rel=\"noopener\">Ley 24/2013, de 26 de diciembre, del Sector El&eacute;ctrico</a>, fundamentalmente en el art&iacute;culo 14.</p>\r\n<p>En ella se concretan tambi&eacute;n los criterios y la forma de revisi&oacute;n de los par&aacute;metros retributivos para las instalaciones de producci&oacute;n a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n de alta eficiencia y residuos con r&eacute;gimen retributivo espec&iacute;fico y se desarrollan en el<span>&nbsp;</span><a href=\"http://www.boe.es/diario_boe/txt.php?id=BOE-A-2014-6123\" target=\"_blank\" rel=\"noopener\">Real Decreto 413/2014, de 6 de junio<span>&nbsp;</span></a>y en la Orden por la que se aprueban los par&aacute;metros retributivos de las instalaciones tipo aplicables a determinadas instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos.</p>', 'donde-se-recogen-las-bases-del-regimen-retributivo-especifico', 1, '2018-06-14 13:39:51', 0, 0),
(4, 1, '¿Qué es una instalación tipo?', '<span>Cada instalaci&oacute;n, en funci&oacute;n de sus caracter&iacute;sticas, tendr&aacute; asignada una instalaci&oacute;n tipo. La instalaci&oacute;n tipo representa una instalaci&oacute;n est&aacute;ndar que agrupa a un conjunto de instalaciones que tienen caracter&iacute;sticas comunes (por ejemplo, tecnolog&iacute;a, potencia, a&ntilde;o de autorizaci&oacute;n de explotaci&oacute;n definitiva, etc.). Para&nbsp;cada instalaci&oacute;n tipo se aprueban unos par&aacute;metros retributivos, de forma que dichos par&aacute;metros retributivos se aplicar&aacute;n a las instalaciones que tengan asignada dicha instalaci&oacute;n tipo.</span>', 'que-es-una-instalacion-tipo', 1, '2018-06-14 13:40:23', 0, 0),
(5, 1, '¿Qué instalaciones han sido automáticamente inscritas en el registro de régimen retributivo específico en estado de preasiganción?', '<span>Quedar&aacute;n inscritas autom&aacute;ticamente en estado de preasignaci&oacute;n aquellas instalaciones que en el momento de realizar la inscripci&oacute;n autom&aacute;tica no est&eacute;n dadas de alta en el sistema de liquidaci&oacute;n de la CNMC, y que tuvieran reconocida retribuci&oacute;n primada. Tal como se establece en la Orden IET/1168/2014, de 3 de julio, la fecha de inscripci&oacute;n autom&aacute;tica es el 9 de julio de 2014.</span>', 'que-instalaciones-han-sido-automaticamente-inscritas-en-el-registro-de-regimen-retributivo-especifico-en-estado-de-preasigancion', 1, '2018-06-14 13:40:39', 0, 0),
(6, 1, 'La resolución de mi solicitud de inscripción en el registro en estado de explotación ha sido favorable, ¿tengo que solicitar la devolución de la garantía?', '<p>No. De acuerdo al apartado 3 de la disposici&oacute;n adicional sexta del Real Decreto 413/2014, de 6 de junio, la Direcci&oacute;n General de Pol&iacute;tica Energ&eacute;tica y Minas, previa comprobaci&oacute;n del cumplimiento de los requisitos exigidos en el apartado 1 de dicha disposici&oacute;n, resolver&aacute;, si procede, inscribir la instalaci&oacute;n en el registro de r&eacute;gimen retributivo espec&iacute;fico en estado de explotaci&oacute;n, cancelar la inscripci&oacute;n en dicho registro en estado de preasignaci&oacute;n, y<span>&nbsp;</span><strong>dictar la orden de cancelaci&oacute;n de la garant&iacute;a depositada para solicitar la inscripci&oacute;n en el registro de preasignaci&oacute;n de retribuci&oacute;n</strong>.</p>\r\n<p>Si la potencia inscrita en el registro en estado de explotaci&oacute;n fuese inferior a la que result&oacute; inscrita en el registro en estado de preasignaci&oacute;n, se cancelar&aacute; en el registro en estado de preasignaci&oacute;n la inscripci&oacute;n correspondiente a la potencia inscrita en el registro en estado de explotaci&oacute;n. Asimismo, se dictar&aacute; orden de cancelaci&oacute;n de la fracci&oacute;n de la garant&iacute;a correspondiente a dicha potencia, salvo que la diferencia entre las citadas potencias sea inferior al 5 por ciento de la potencia originalmente inscrita en el registro en estado de preasignaci&oacute;n y dicha fracci&oacute;n de garant&iacute;a sea inferior a 1.000 euros, en cuyo caso se dictar&aacute; resoluci&oacute;n de cancelaci&oacute;n de la garant&iacute;a correspondiente a la totalidad de la potencia.</p>', 'la-resolucion-de-mi-solicitud-de-inscripcion-en-el-registro-en-estado-de-explotacion-ha-sido-favorable-tengo-que-solicitar-la-devolucion-de-la-garantia', 1, '2018-06-14 13:40:54', 0, 0),
(7, 1, '¿Dónde puedo consultar los datos de mi instalación relativos al régimen retributivo específico?', '<p>En la Sede Electr&oacute;nica del Ministerio de Industria, Energ&iacute;a y Turismo, mediante el enlace a la aplicaci&oacute;n inform&aacute;tica del nuevo registro de r&eacute;gimen retributivo espec&iacute;fico. En este enlace, y mediante certificado electr&oacute;nico (DNI electr&oacute;nico o certificado electr&oacute;nico de persona f&iacute;sica o jur&iacute;dica) podr&aacute; acceder a los datos de su instalaci&oacute;n.</p>\r\n<p>Seg&uacute;n la Disposici&oacute;n transitoria primera del<span>&nbsp;</span><a href=\"http://www.boe.es/diario_boe/txt.php?id=BOE-A-2014-6123\" target=\"_blank\" rel=\"noopener\">Real Decreto 413/2014, de 6 de junio</a>, las inscripciones en el registro de r&eacute;gimen retributivo espec&iacute;fico tienen dos estados: Preasignaci&oacute;n y Explotaci&oacute;n. Tras la inscripci&oacute;n autom&aacute;tica inicial:</p>\r\n<ul class=\"faq-list\">\r\n<li>Quedar&aacute;n inscritas en<span>&nbsp;</span><strong>estado de preasignaci&oacute;n</strong><span>&nbsp;</span>aquellas instalaciones que en el momento de realizar la inscripci&oacute;n autom&aacute;tica no est&eacute;n dadas de alta en el sistema de liquidaci&oacute;n de la CNMC, y que tuvieran reconocida retribuci&oacute;n primada.</li>\r\n<li>Quedar&aacute;n inscritas en<span>&nbsp;</span><strong>estado de explotaci&oacute;n<span>&nbsp;</span></strong>aquellas instalaciones que en el momento de realizar la inscripci&oacute;n autom&aacute;tica est&eacute;n dadas de alta en el sistema de liquidaci&oacute;n de la CNMC, sin perjuicio de lo previsto en las disposiciones adicionales s&eacute;ptima y octava del Real Decreto 413/2014, de 6 de junio.</li>\r\n</ul>\r\n<p>Seg&uacute;n la Orden IET/1168/2014, de 3 de julio, las instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos que tuvieran reconocida retribuci&oacute;n primada a la entrada en vigor del Real Decreto-ley 9/2013, de 12 de julio, han sido inscritas autom&aacute;ticamente en el registro de r&eacute;gimen retributivo espec&iacute;fico con fecha 9 de julio de 2014.</p>\r\n<p>Los datos de las instalaciones existentes en dicho registro pueden consultarse a trav&eacute;s la<span>&nbsp;</span><a href=\"https://sedeaplicaciones.minetur.gob.es/Eride.Web.ui/(S(ku3qtknhxnzahu2ggp3z55fb))/Vista/Login.aspx\" target=\"_blank\" rel=\"noopener\">aplicaci&oacute;n inform&aacute;tica</a><span>&nbsp;</span>del nuevo registro de r&eacute;gimen retributivo espec&iacute;fico.</p>', 'donde-puedo-consultar-los-datos-de-mi-instalacion-relativos-al-regimen-retributivo-especifico', 1, '2018-06-14 13:41:23', 0, 0),
(8, 1, '¿Cómo se clasifican las instalaciones de acuerdo con el Real Decreto 413/2014, de 6 de junio?', '<p>Las instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos inclu&iacute;das en el &aacute;mbito de aplicaci&oacute;n del Real Decreto 413/2014, de 6 de junio, han sido clasificadas en categor&iacute;as, grupos y subgrupos, que se definen en el art&iacute;culo 2 del citado Real Decreto y que son los siguientes:</p>\r\n<p><strong><a href=\"http://www.mincotur.gob.es/energia/electricidad/energias-renovables/Paginas/clasificacion-instalaciones-RD413-2014.aspx#categoria%20a\" target=\"_blank\" rel=\"noopener\">Categor&iacute;a a)</a></strong></p>\r\n<p>Productores que utilicen la cogeneraci&oacute;n u otras formas de producci&oacute;n de electricidad a partir de energ&iacute;as residuales.</p>\r\n<p><strong><a href=\"http://www.mincotur.gob.es/energia/electricidad/energias-renovables/Paginas/clasificacion-instalaciones-RD413-2014.aspx#categoria%20b\" target=\"_blank\" rel=\"noopener\">Categor&iacute;a b)</a></strong></p>\r\n<p>Instalaciones que utilicen como energ&iacute;a primaria alguna de las energ&iacute;as renovables no f&oacute;siles.</p>\r\n<p><strong><a href=\"http://www.mincotur.gob.es/energia/electricidad/energias-renovables/Paginas/clasificacion-instalaciones-RD413-2014.aspx#categoria%20c\" target=\"_blank\" rel=\"noopener\">Categor&iacute;a c)</a></strong></p>\r\n<p>Instalaciones que utilicen como energ&iacute;a primaria residuos con valorizaci&oacute;n energ&eacute;tica no contemplados en la categor&iacute;a b), instalaciones que utilicen combustibles de los grupos b.6, b.7 y b.8 cuando no cumplan con los l&iacute;mites de consumo establecidos para los citados subgrupos e instalaciones que utilicen licores negros.</p>', 'como-se-clasifican-las-instalaciones-de-acuerdo-con-el-real-decreto-413-2014-de-6-de-junio', 1, '2018-06-14 13:41:51', 0, 0),
(9, 1, '¿Cuándo se producirá la inscripción automática de las instalaciones en el Registro de Régimen Específico Retributivo?', '<span>Seg&uacute;n la disposici&oacute;n transitoria primera del&nbsp;</span><a href=\"http://www.boe.es/diario_boe/txt.php?id=BOE-A-2014-6123\" target=\"_blank\" rel=\"noopener\">Real Decreto 413/2014, de 6 de junio</a><span>,&nbsp;quedar&aacute;n autom&aacute;ticamente inscritas en el registro de r&eacute;gimen retributivo espec&iacute;fico las instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos que tuvieran reconocida retribuci&oacute;n primada a la entrada en vigor del Real Decreto-ley 9/2013, de 12 de julio. Tal como se establece en la Orden IET/1168/2014, de 3 de julio, la fecha de inscripci&oacute;n autom&aacute;tica es el 9 de julio de 2014.</span>', 'cuando-se-producira-la-inscripcion-automatica-de-las-instalaciones-en-el-registro-de-regimen-especifico-retributivo', 1, '2018-06-14 13:42:10', 0, 0),
(10, 1, '¿Por qué términos está compuesto el Régimen Retributivo Específico?', '<p>El r&eacute;gimen retributivo espec&iacute;fico est&aacute; compuesto por dos t&eacute;rminos:</p>\r\n<ul class=\"faq-list\">\r\n<li><strong>Retribuci&oacute;n a la inversi&oacute;n:</strong><span>&nbsp;</span>es un t&eacute;rmino por unidad de potencia instalada destinado a cubrir, cuando proceda, los costes de inversi&oacute;n para cada instalaci&oacute;n tipo que no puedan ser recuperados por la venta de la energ&iacute;a en el mercado.</li>\r\n<li><strong>Retribuci&oacute;n a la operaci&oacute;n:</strong><span>&nbsp;</span>es un t&eacute;rmino a la operaci&oacute;n que cubrir&aacute;, en su caso, la diferencia entre los costes de explotaci&oacute;n y los ingresos de explotaci&oacute;n de dicha instalaci&oacute;n tipo.</li>\r\n</ul>\r\n<p>Excepcionalmente, el r&eacute;gimen retributivo espec&iacute;fico podr&aacute; incorporar adem&aacute;s un incentivo a la inversi&oacute;n cuando su instalaci&oacute;n suponga una reducci&oacute;n significativa de los costes en los sistemas de los territorios no peninsulares.</p>', 'por-que-terminos-esta-compuesto-el-regimen-retributivo-especifico', 1, '2018-06-14 13:42:24', 0, 0),
(11, 1, '¿Cómo puedo estimar la retribución que voy a percibir con la nueva normativa?', '<span>En primer lugar, se deber&aacute; conocer cu&aacute;l es la instalaci&oacute;n tipo que le corresponde a su instalaci&oacute;n. A partir de ah&iacute;, la retribuci&oacute;n concreta de cada instalaci&oacute;n se obtendr&aacute; a partir de los par&aacute;metros retributivos de la instalaci&oacute;n tipo que le corresponda y de las caracter&iacute;sticas de la propia instalaci&oacute;n.</span>', 'como-puedo-estimar-la-retribucion-que-voy-a-percibir-con-la-nueva-normativa', 1, '2018-06-14 13:42:37', 0, 0),
(12, 1, '¿Qué instalaciones han sido automáticamente inscritas en el registro de régimen retributivo específico en estado de explotación?', '<span>Aquellas instalaciones que en el momento de realizar la inscripci&oacute;n autom&aacute;tica est&eacute;n dadas de alta en el sistema de liquidaci&oacute;n de la CNMC, sin perjuicio de lo previsto en las disposiciones adicionales s&eacute;ptima y octava del&nbsp;</span><a href=\"http://www.boe.es/diario_boe/txt.php?id=BOE-A-2014-6123\" target=\"_blank\" rel=\"noopener\">Real Decreto 413/2014, de 6 de junio</a><span>. (Apartado 2.b de la disposici&oacute;n transitoria primera), quedar&aacute;n inscritas autom&aacute;ticamente en estado de explotaci&oacute;n. Tal como se establece en la Orden IET/1168/2014, de 3 de julio, la fecha de inscripci&oacute;n autom&aacute;tica es el 9 de julio de 2014.</span>', 'que-instalaciones-han-sido-automaticamente-inscritas-en-el-registro-de-regimen-retributivo-especifico-en-estado-de-explotacion', 1, '2018-06-14 13:43:04', 0, 0),
(13, 1, '¿Puedo recuperar la garantía depositada para cursar una solicitud que hice al amparo del RD 1578/2008 o RD Ley 6/2009 de 30 de abril, que fue desfavorable?', '<p>Si solicit&oacute; la inscripci&oacute;n en el registro de preasignaci&oacute;n de retribuci&oacute;n regulado en el real decreto 1578/2008, de 26 de septiembre,&nbsp; o en el Real decreto ley 6/2009, de 30 de abril, y su solicitud no fue resuelta favorablemente puede recuperar las garant&iacute;as depositadas. Para ello, deber&aacute; dirigir en el plazo de seis meses desde la entrada en vigor del Real Decreto 413/2014, de 6 de junio, ante la Direcci&oacute;n General de Pol&iacute;tica Energ&eacute;tica y Minas<span>&nbsp;</span><strong>en papel<span>&nbsp;</span></strong>lo siguiente:</p>\r\n<ul class=\"faq-list\">\r\n<li>Solicitud interesando la devoluci&oacute;n de las garant&iacute;as que hubieran depositado al amparo de lo previsto en los art&iacute;culos 59 bis y 66 bis del Real Decreto 1955/2000, de 1 de diciembre, por el que se regulan las actividades de transporte, distribuci&oacute;n, comercializaci&oacute;n, suministro y procedimientos de autorizaci&oacute;n de instalaciones de energ&iacute;a el&eacute;ctrica, del art&iacute;culo 9 del Real Decreto 1578/2008, de 26 de septiembre, as&iacute; como del art&iacute;culo 4.3.i del Real Decreto-ley 6/2009, de 30 de abril, sin que, haya lugar, en virtud de ese desistimiento, a la ejecuci&oacute;n de tales garant&iacute;as.</li>\r\n<li>Desistimiento de su solicitud de inscripci&oacute;n en el referido registro.</li>\r\n</ul>\r\n<p>En su caso, desistimiento de su solicitud de acceso a la red.</p>', 'puedo-recuperar-la-garantia-depositada-para-cursar-una-solicitud-que-hice-al-amparo-del-rd-1578-2008-o-rd-ley-6-2009-de-30-de-abril-que-fue-desfavorable', 1, '2018-06-14 13:43:17', 0, 0),
(14, 1, '¿Hay que pagar alguna tasa por inscribirse en el registro de régimen retributivo específico?', '<span>No. Las inscripciones que se realicen en el registro de r&eacute;gimen retributivo espec&iacute;fico no devengar&aacute;n el cobro de tasas.</span>', 'hay-que-pagar-alguna-tasa-por-inscribirse-en-el-registro-de-regimen-retributivo-especifico', 1, '2018-06-14 13:43:31', 0, 0),
(15, 1, '¿Cómo es el reparto de competencias entre la Administración General del Estado y las Comunidades Autónomas?', '<h2>Corresponde a la Administraci&oacute;n General del Estado</h2>\r\n<p>A&nbsp;trav&eacute;s de la Direcci&oacute;n General de Pol&iacute;tica Energ&eacute;tica y Minas del Ministerio de Industria, Energ&iacute;a y Turismo, sin perjuicio de las competencias que tengan atribuidas otros departamentos ministeriales, las siguientes:</p>\r\n<p><strong>1. La autorizaci&oacute;n administrativa</strong></p>\r\n<p>Para la puesta en funcionamiento de nuevas instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos, y modificaci&oacute;n de las existentes, as&iacute; como para la transmisi&oacute;n, cierre temporal y cierre definitivo de las mismas, en los siguientes casos:</p>\r\n<ul class=\"faq-list\">\r\n<li>Instalaciones peninsulares, incluyendo sus infraestructuras de evacuaci&oacute;n, de potencia el&eacute;ctrica instalada superior a 50 MW el&eacute;ctricos.</li>\r\n<li>Instalaciones, incluyendo sus infraestructuras de evacuaci&oacute;n, que excedan del &aacute;mbito territorial de una Comunidad Aut&oacute;noma.</li>\r\n<li>Instalaciones ubicadas en el mar territorial.</li>\r\n<li>Instalaciones de potencia el&eacute;ctrica instalada superior a 50 MW el&eacute;ctricos ubicadas en los territorios no peninsulares, cuando sus sistemas el&eacute;ctricos est&eacute;n efectivamente integrados con el sistema peninsular.</li>\r\n</ul>\r\n<p><strong>2.&nbsp; La inscripci&oacute;n en el registro administrativo de instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica</strong></p>\r\n<p>De las instalaciones que sean de su competencia de acuerdo con el apartado anterior, y la modificaci&oacute;n o cancelaci&oacute;n de dichas inscripciones, as&iacute; como la toma de raz&oacute;n en dicho registro de las inscripciones de las instalaciones de competencia auton&oacute;mica.</p>\r\n<p><strong>3. El otorgamiento del r&eacute;gimen retributivo espec&iacute;fico</strong></p>\r\n<p>Regulado en el t&iacute;tulo IV del Real Decreto 413/2014, de 6 de junio, as&iacute; como la verificaci&oacute;n del cumplimiento por parte de los titulares de las instalaciones de las condiciones exigibles para tener derecho a su percepci&oacute;n y, en su caso, la revocaci&oacute;n de dicho derecho.</p>\r\n<p><strong>4. La inscripci&oacute;n en el registro de r&eacute;gimen retributivo espec&iacute;fico</strong></p>\r\n<p>As&iacute; como la modificaci&oacute;n o cancelaci&oacute;n de dichas inscripciones de las instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n de alta eficiencia y residuos.</p>\r\n<h2>Corresponde a las Comunidades Aut&oacute;nomas</h2>\r\n<p><strong>La autorizaci&oacute;n administrativa.</strong></p>\r\n<p>Para la puesta en funcionamiento de nuevas instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica a partir de fuentes de energ&iacute;a renovables, cogeneraci&oacute;n y residuos, y modificaci&oacute;n de las existentes, as&iacute; como para la transmisi&oacute;n, cierre temporal y cierre definitivo de las mismas, en los casos no contemplados en el apartado 1 anterior.</p>\r\n<p><strong>El registro administrativo de instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica.</strong></p>\r\n<p>As&iacute; mismo, corresponde a las Comunidades Aut&oacute;nomas la inscripci&oacute;n en el registro administrativo de instalaciones de producci&oacute;n de energ&iacute;a el&eacute;ctrica, as&iacute; como la modificaci&oacute;n o cancelaci&oacute;n de dichas inscripciones para las instalaciones que sean de su competencia.</p>', 'como-es-el-reparto-de-competencias-entre-la-administracion-general-del-estado-y-las-comunidades-autonomas', 1, '2018-06-14 13:43:54', 0, 0),
(16, 2, 'Nueva facturación horaria', '<blockquote>Las compa&ntilde;&iacute;as el&eacute;ctricas tienen desde el 1 de julio hasta el 1 de octubre de 2015 para adaptarse y comenzar a aplicar la facturaci&oacute;n horaria a todos sus clientes acogidos al<span>&nbsp;</span><a href=\"http://www.controlastuenergia.gob.es/factura-electrica/contratos/Paginas/PVPC.aspx\" target=\"_blank\" rel=\"noopener\"><abbr title=\"Precio Voluntario para el Peque&ntilde;o Consumidor\">PVPC</abbr></a>. La facturaci&oacute;n se realizar&aacute; aplicando al consumo real en cada hora el precio horario de la energ&iacute;a en el mercado mayorista de electricidad. Anteriormente se estimaba la distribuci&oacute;n horaria del consumo mediante un perfil elaborado por Red El&eacute;ctrica.</blockquote>\r\n<p>Como consecuencia de este cambio, el consumidor podr&aacute; ahorrar desplazando ciertos consumos a las horas en que la electricidad es m&aacute;s barata, por ejemplo programando lavadora o lavavajillas para que funcionen durante la madrugada.</p>\r\n<p>Todos los contadores deber&aacute;n ser sustituidos por contadores inteligentes antes de finalizar el a&ntilde;o 2018. No obstante, a aquellos consumidores que no dispongan a&uacute;n de contador efectivamente integrado, se les seguir&aacute; facturando como hasta ahora.</p>\r\n<p>Estos cambios se a&ntilde;aden a los ya producidos en 2014, puesto que desde entonces, se factura la energ&iacute;a consumida tomando como referencia el precio de la electricidad del mercado mayorista, que cotiza y cambia en funci&oacute;n de la oferta y la demanda cada hora. Esta informaci&oacute;n puede consultarse diariamente en<span>&nbsp;</span><a href=\"http://www.ree.es/es/actividades/operacion-del-sistema-electrico/precio-voluntario-pequeno-consumidor-pvpc\" title=\"Abre en ventana nueva\" target=\"_blank\" rel=\"noopener\">la web de Red El&eacute;ctrica</a>.</p>', 'nueva-facturacion-horaria', 1, '2018-06-14 13:45:41', 0, 0),
(17, 2, 'Entender la factura de electricidad', '<div style=\"text-align: center;\"><img src=\"https://clientes.energiareal.es/media/factura-electrica-1.jpg\" width=\"700\" height=\"1015\" alt=\"\" style=\"display: block; margin-left: auto; margin-right: auto;\" /><br /><img src=\"https://clientes.energiareal.es/media/factura-electrica-2.jpg\" width=\"700\" height=\"1015\" alt=\"\" /><br /><br /><img src=\"https://clientes.energiareal.es/media/factura-electrica-3.jpg\" width=\"700\" height=\"1015\" alt=\"\" /></div>\r\n<br />\r\n<p>El&nbsp;Ministerio de Industria, Energ&iacute;a y&nbsp;Turismo (actual&nbsp;&nbsp;Ministerio de Energ&iacute;a, Turismo y Agenda Digital), a trav&eacute;s de la<span>&nbsp;</span><a href=\"http://www.boe.es/diario_boe/txt.php?id=BOE-A-2014-5655\" target=\"_blank\" title=\"Abre en ventana nueva\" rel=\"noopener\">Resoluci&oacute;n de 23 de mayo de 2014, de la Direcci&oacute;n General de Pol&iacute;tica Energ&eacute;tica y Minas, por la que se establece el contenido m&iacute;nimo y el modelo de factura de electricidad</a>, ha definido un modelo de factura el&eacute;ctrica que&nbsp;han adoptado las&nbsp;comercializadoras de referencia con el fin de&nbsp;facilitar la comprensi&oacute;n por parte del consumidor.</p>\r\n<p>El&nbsp;modelo de factura es obligatorio&nbsp;para las comercializadoras de referencia que suministren a los consumidores acogidos a precio voluntario para el peque&ntilde;o consumidor (PVPC), incluidos los consumidores vulnerables a los que aplica el bono social, y a los consumidores sin derecho a acogerse al precio voluntario para el peque&ntilde;o consumidor que transitoriamente carezcan de un contrato de suministro con una comercializadora en mercado libre.</p>\r\n<p>A trav&eacute;s de este modelo de factura, se pretende que las facturas el&eacute;ctricas faciliten informaci&oacute;n sobre los consumos y los costes asociados de forma clara y concisa. El objetivo es que el consumidor pueda&nbsp;realizar comparaciones entre distintas ofertas y posibilite el conocimiento sobre&nbsp;su coste de&nbsp;suministro, precios, tarifas y condiciones generales del acceso y uso de los servicios de electricidad.</p>\r\n<p>El destino del importe de la factura,&nbsp;el origen e impacto ambiental de la electricidad consumida se incorporan tambi&eacute;n como parte del contenido de la factura.</p>', 'entender-la-factura-de-electricidad', 1, '2018-06-14 13:48:38', 0, 0),
(18, 2, 'Conceptos por los que pago en mi factura de electricidad', '<p>A continuaci&oacute;n se explican de manera sencilla y mediante un ejemplo tipo, los<span>&nbsp;</span><strong>5 conceptos</strong><span>&nbsp;</span>por los que pago en mi factura de electricidad:</p>\r\n<ol>\r\n<li>T&eacute;rmino de potencia</li>\r\n<li>T&eacute;rmino de energ&iacute;a</li>\r\n<li>Impuesto especial sobre la electricidad</li>\r\n<li>Alquiler del equipo de medida</li>\r\n<li>Impuesto sobre el Valor A&ntilde;adido (IVA)</li>\r\n</ol>\r\n<p>Con la finalidad de facilitar la comprensi&oacute;n de su factura, en este apartado se procede a explicar, a trav&eacute;s de un ejemplo, los distintos conceptos que aparecen en la secci&oacute;n de detalle de cualquier factura de un consumidor con contrato a Precio Voluntario para el Peque&ntilde;o Consumidor (PVPC) sin aplicaci&oacute;n de bono social y sin discriminaci&oacute;n horaria.</p>\r\n<h2>Datos de ejemplo de la factura:</h2>\r\n<ul class=\"faq-list no-margin\">\r\n<li>Tipo de contrato:<span>&nbsp;</span><a href=\"http://www.controlastuenergia.gob.es/Paginas/glosario.aspx?lt=P#PVPC\" target=\"_blank\" rel=\"noopener\">PVPC</a><span>&nbsp;</span>sin discriminaci&oacute;n horaria.</li>\r\n<li><a title=\"Ver definici&oacute;n de peaje de acceso\" href=\"http://www.controlastuenergia.gob.es/Paginas/glosario.aspx?lt=P#Peaje-acceso\" target=\"_blank\" rel=\"noopener\">Peaje de acceso</a>: 2.0A.</li>\r\n<li>Potencia contratada: 3,9 Kw.</li>\r\n<li>N&uacute;mero de d&iacute;as del per&iacute;odo de facturaci&oacute;n: 59 d&iacute;as.</li>\r\n<li>Precio medio del t&eacute;rmino de coste de la energ&iacute;a: 0,07436 kWh.</li>\r\n<li>Consumo de energ&iacute;a en per&iacute;odo de facturaci&oacute;n: 375 kW/h.</li>\r\n<li>Equipo de<span>&nbsp;</span><a title=\"Ver definici&oacute;n de telemedida\" href=\"http://www.controlastuenergia.gob.es/Paginas/glosario.aspx?lt=T#Telemedida\" target=\"_blank\" rel=\"noopener\">medida</a><span>&nbsp;</span>sin contador inteligente efectivamente integrado en el sistema de telegesti&oacute;n y en r&eacute;gimen de alquiler.</li>\r\n</ul>\r\n<p>El detalle de los principales t&eacute;rminos de su factura incluir&aacute; los conceptos que se indican a continuaci&oacute;n.</p>\r\n<h3 id=\"potencia\">1. T&eacute;rmino de potencia</h3>\r\n<p>El T&eacute;rmino de Potencia es un precio fijo que resulta de tener disponible en todo momento la potencia contratada. Este precio se calcula multiplicando la potencia contratada, por los d&iacute;as que engloba la factura y por el t&eacute;rmino de potencia del precio PVPC que el&nbsp;Ministerio de Energ&iacute;a, Turismo y Agenda Digital establece.</p>\r\n<p>El t&eacute;rmino de potencia del PVPC integra el precio del t&eacute;rmino de potencia del peaje de acceso y el margen de comercializaci&oacute;n.</p>\r\n<p>Actualmente, el precio del t&eacute;rmino de potencia del peaje de acceso est&aacute; fijado en 38,043426 &euro;/kW-a&ntilde;o. El margen de comercializaci&oacute;n est&aacute; fijado en 4 &euro;/kW-a&ntilde;o.</p>\r\n<p>Para que el c&aacute;lculo del t&eacute;rmino de potencia de la facturaci&oacute;n sea conveniente, es precio convertir los precios anteriores de t&eacute;rminos de &euro;/kW-a&ntilde;o a &euro;/kW-d&iacute;a</p>\r\n<p><span class=\"block\">Esto es:</span></p>\r\n<p>T&eacute;rmino de potencia del peaje de acceso:<span class=\"block\">38,043426 &euro;/kW/a&ntilde;o x 1/365 = 0,104229 &euro;/kW/d&iacute;a</span></p>\r\n<p>Margen de comercializaci&oacute;n:<span class=\"block\">4 &euro;/kW/a&ntilde;o x 1/365 = 0,010959 &euro;/kW/d&iacute;a</span></p>\r\n<p>Por consiguiente, la facturaci&oacute;n del t&eacute;rmino de potencia para el per&iacute;odo de 59 d&iacute;as del per&iacute;odo de facturaci&oacute;n mencionado de 2015 es el siguiente:<span class=\"block\">3,9 kW/a&ntilde;o * (0,104229 &euro;/kW/d&iacute;a + 0,010959 &euro;/kW/d&iacute;a) * 59 d&iacute;as = 26,50 &euro;</span></p>\r\n<h3 id=\"energia\">2. T&eacute;rmino de energ&iacute;a</h3>\r\n<p>El T&eacute;rmino de energ&iacute;a es un precio que se compone del t&eacute;rmino de energ&iacute;a del peaje de acceso (fijo) y del coste de producci&oacute;n de la energ&iacute;a el&eacute;ctrica en cada per&iacute;odo (variable).</p>\r\n<p>El t&eacute;rmino de energ&iacute;a del peaje de acceso viene determinado por el&nbsp;Ministerio de Energ&iacute;a, Turismo y Agenda Digital. Actualmente est&aacute; fijado en: 0,044027 &euro;/kWh.</p>\r\n<p>El coste de producci&oacute;n de energ&iacute;a el&eacute;ctrica se compone del precio horario del mercado de electricidad, de los servicios de ajuste del sistema as&iacute; como de otros costes asociados al suministro. El coste de producci&oacute;n se publica en la p&aacute;gina web del operador del sistema Red El&eacute;ctrica de Espa&ntilde;a S.A.</p>\r\n<p>En concreto para el ejemplo, el coste de producci&oacute;n de energ&iacute;a el&eacute;ctrica para el per&iacute;odo de facturaci&oacute;n ha sido de 0,07436 &euro;/kWh.</p>\r\n<p>Por consiguiente, el t&eacute;rmino de energ&iacute;a para el per&iacute;odo de facturaci&oacute;n elegido ser&iacute;a de:<span class=\"block\">375 kWh x (0,044027 &euro;/kWh+ 0,07436 &euro;/kWh)= 44,40 &euro;</span></p>\r\n<h3 id=\"impuesto\">3. Impuesto sobre la electricidad</h3>\r\n<p>El impuesto sobre la electricidad es un impuesto especial cuyo tipo impositivo viene determinado por ley. Desde el 1 de enero de 2015 (5,1127%).</p>\r\n<p>La base imponible es el importe resultante de la suma del t&eacute;rmino de potencia y del t&eacute;rmino de energ&iacute;a.<span class=\"block\">5,1127% x (26,50 &euro;+ 44,40 &euro;)= 3,62 &euro;</span></p>\r\n<h3 id=\"equipos\">4. Equipos de medida y control</h3>\r\n<p>El precio del alquiler mensual del contador (si &eacute;ste no es en propiedad), est&aacute; establecido por el&nbsp;Ministerio de Energ&iacute;a, Turismo y Agenda Digital.</p>\r\n<p>Con car&aacute;cter general, los precios del contador son:</p>\r\n<div class=\"tabladatos\">\r\n<table>\r\n<thead>\r\n<tr>\r\n<th id=\"conceptos-2\" scope=\"col\">Tipo de contador</th>\r\n<th id=\"importes-2\" scope=\"col\">Precio &euro;/mes</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td headers=\"conceptos-2\">Contador simple tarifa sin posibilidad de telegesti&oacute;n</td>\r\n<td headers=\"importes-2\">0,54</td>\r\n</tr>\r\n<tr>\r\n<td headers=\"conceptos-2\">Contadores con discriminaci&oacute;n horaria sin posibilidad de telegesti&oacute;n</td>\r\n<td headers=\"importes-2\">1,11</td>\r\n</tr>\r\n<tr>\r\n<td headers=\"conceptos-2\">Contadores electr&oacute;nicos monof&aacute;sicos con discriminaci&oacute;n horaria y con posibilidad de telegesti&oacute;n para consumidores dom&eacute;sticos</td>\r\n<td headers=\"importes-2\">0,81</td>\r\n</tr>\r\n<tr>\r\n<td headers=\"conceptos-2\">Contadores electr&oacute;nicos trif&aacute;sicos con discriminaci&oacute;n horaria y con posibilidad de telegesti&oacute;n</td>\r\n<td headers=\"importes-2\">1,36</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p>(*) El precio del alquiler del contador incluye el importe correspondiente al ICP (0,03 &euro;/mes).</p>\r\n<p>Para el ejemplo en concreto, el importe del contador ser&iacute;a de 1,14 &euro; (0,57 &euro;/mes).</p>\r\n<h3>5. Total energ&iacute;a y otros conceptos</h3>\r\n<p>Este t&eacute;rmino recoge el importe total a facturar (t&eacute;rmino de potencia, t&eacute;rmino de energ&iacute;a, impuesto sobre la electricidad y alquiler del contador) y dem&aacute;s conceptos detallados en los apartados anteriores. Sobre este importe se a&ntilde;ade el IVA.<span class=\"block\">(26,50 &euro;+ 44,40 &euro; + 3,62 &euro;+1,14 &euro; )= 75,67 &euro;</span></p>\r\n<h3 id=\"iva\">6. Impuesto sobre el Valor A&ntilde;adido (IVA)</h3>\r\n<p>Se aplica el tipo vigente sobre la suma de los conceptos anteriores (21%**).<span class=\"block\">(75,67 &euro; ) x 21%= 15,89 &euro;</span></p>\r\n<p>(**) En el caso de Canarias, aplicar&iacute;a el IGIC al tipo vigente</p>\r\n<h3>7. Total importe factura</h3>\r\n<p>Es el importe final de factura a pagar.<span class=\"block\">(75,67 &euro; +15,89 &euro;) = 91,56 &euro;</span></p>', 'conceptos-por-los-que-pago-en-mi-factura-de-electricidad', 1, '2018-06-14 13:49:53', 0, 0);

